// CSS File
import "./App.css";
// Styled-styledComponents
import Styled from "styled-components";
function App() {
  const DivStyle = Styled.div`
    border: 5px solid black;
    width: 300px;
    height: 250px;
    padding: 5px 10px;
    margin: 20px auto;
  `;
  const Circle = Styled.div`
    background-color: white;
    width: 100px;
    height: 100px;
  `;
  return <DivStyle>Hellow World</DivStyle>;
}

export default App;
